import React, { useState, useEffect } from 'react';


export default function Popup(props) {
    let { onSelect } = useState();
    useEffect(() => {
        onSelect = onSelect;
    }, [props.onSelect])

    const handleChange = () => {
        console.log(onSelect);
        onSelect();
    }

    return (
        <button className="" onClick={handleChange}>
            Hi
        </button>
    );
}
